        /// <summary>
        /// System Timer
        /// </summary>
        System.Timers.Timer timer;

        /// <summary>
        /// Constructor of form
        /// </summary>
        public WeeForm()
        {
            InitializeComponent();
            timer = new System.Timers.Timer(100);
            timer.Elapsed += new System.Timers.ElapsedEventHandler(Timer_Tick);
        }

        /// <summary>
        /// Start System
        /// </summary>
        public void Start()
        {
            System.IO.File.Delete(FileName);
            timer.Start();
        }

        /// <summary>
        /// Stop System
        /// </summary>
        public void Stop()
        {
            timer.Stop();
        }

        /// <summary>
        /// Timer Tick handler
        /// </summary>
        /// <param name="obj"></param>
        /// <param name="args"></param>
        void Timer_Tick(object obj, System.Timers.ElapsedEventArgs args)
        {
            timer.Enabled = false;
            MeasureMouse();
            timer.Enabled = true;
        }

        #region Mouse Tracker

        /// <summary>
        /// Movement Speed
        /// </summary>
        double MoveSpeed = 0;

        /// <summary>
        /// Previous X Position
        /// </summary>
        int PrevX = 0;

        /// <summary>
        /// Previous Y Position
        /// </summary>
        int PrevY = 0;

        void MeasureMouse()
        {
            int CurrX = Cursor.Position.X;
            int CurrY = Cursor.Position.Y;
            int DiffX = CurrX - PrevX;
            int DiffY = CurrY - PrevY;

            MoveSpeed = Math.Sqrt(DiffX * DiffX + DiffY * DiffY);

            if (MoveSpeed > 500)
                StartPlay();
            
            PrevX = CurrX;
            PrevY = CurrY;
        }


        #endregion Mouse Tracker

        #region Sound Generator

        /// <summary>
        /// File name
        /// </summary>
        const string FileName = "wee.wav";

        /// <summary>
        /// Flag for playing state
        /// </summary>
        bool Playing = false;

        /// <summary>
        /// Start a new thread for sound
        /// </summary>
        void StartPlay()
        {
            if (!Playing)
                System.Threading.ThreadPool.QueueUserWorkItem(PlaySound, null);
        }

        /// <summary>
        /// Play Sound in Sync
        /// </summary>
        /// <param name="obj"></param>
        void PlaySound(object obj)
        {
            Playing = true;
            PrepareSoundWave();
            System.Media.SoundPlayer player = new System.Media.SoundPlayer(FileName);
            player.PlaySync();

            Playing = false;
        }

        /// <summary>
        /// Prepare sound wave file to play
        /// </summary>
        /// <param name="FileName">File Name of wav</param>
        void PrepareSoundWave()
        {
            if (!System.IO.File.Exists(FileName))
            {
                List<byte> data = new List<byte>();
                foreach (var B in BLOB)
                    data.AddRange(ReadBlob(B));
                System.IO.File.WriteAllBytes(FileName, data.ToArray());
            }    
        }

        #endregion Sound Generator

        #region Blob

        /// <summary>
        /// Get Blob from a file
        /// </summary>
        /// <param name="FileName"></param>
        /// <returns></returns>
        public static string WriteBlob(string FileName)
        {
            byte[] blob = System.IO.File.ReadAllBytes(FileName);
            StringBuilder sb = new StringBuilder();
            foreach (var b in blob)
                sb.Append(b.ToString("x2"));
            return sb.ToString();
        }

        /// <summary>
        /// Read byte array from a blob
        /// </summary>
        /// <param name="Blob"></param>
        /// <returns></returns>
        public static byte[] ReadBlob(string Blob)
        {
            List<byte> data = new List<byte>();
            while (Blob.Length > 1)
            {
                data.Add(Convert.ToByte(Blob.Substring(0, 2), 16));
                Blob = Blob.Remove(0, 2);
            }
            return data.ToArray();
        }

